; Preserve Y and set ram tilemap buffer dest
	rep #IDX_8                                                  ; $d109 : $c2, $10
	phy                                                  ; $d10b : $5a
	jsr Func_2_d26e.w                                                  ; $d10c : $20, $6e, $d2
