; Y = src offset
	rep #IDX_8                                                                ; $d12d : $c2, $10
	ldy #$0000.w                                                              ; $d12f : $a0, $00, $00

@nextControlByte:
; Get a control byte, low 5 bits is num bytes to copy
	sep #ACCU_8                                                               ; $d132 : $e2, $20
	lda [<wTileMapRomSrc]                                                     ; $d134 : $a7, $06
