	.dw (TileMapSpecs@bank0dh-TileMapSpecs)/2 ; $11b
	.dw (TileMapSpecs@bank0eh-TileMapSpecs)/2 ; $120
	.dw (TileMapSpecs@bank0fh-TileMapSpecs)/2 ; $190
